@ascott - Pleased to say I have made some progress on this! Upgraded to Chrome Version 51.0.2704.106 (64-bit). The issue was still there. Wanted to rule out anything in my fork so ran the example data and standard version. Still there. 

Then I used window resizer (https://chrome.google.com/webstore/detail/window-resizer/kkelicaakdanhinjdeammmilcgefonfh?hl=en) to change the window size to 1280 x 1024 and hit refresh on my browser. Scroll bars were gone! But the strangest part is now I can't get them back. Either in my fork or the standard version. So, maybe it was upgrading Chrome. A bit of a mystery. 

I'm going to close this issue though now and if I ever figure it out completely I'll let you know.

None/NaN values are displayed as 0 (by using `df.fillna(0)` in   https://github.com/airbnb/caravel/blob/d5b8414fde5e1a000f0faab9b801ba899959560a/caravel/viz.py#L161), so id_type=0 should be filtered out successfully, what you see should be id_type=None or NaN. 
If you want to verify this, you can group by id_type and see if there are more than one records with id_type=0. If there are two records, then one of them is id_type=0, while the other one is id_type=None/NaN.
@mistercrunch Should we do something like fillna('(NaN)') or just don't fillna at all?
